    false,nt"url": null,nt"notes": "This data set represents the estimated
    percentage of the 1-km grid cell that is covered by or subject to the agricultural
    conservation practice (CP320), Irrigation Canals or Laterals on agricultural land
    by county. An Irrigation Canals or Laterals (ICL) is a "permanent channel constructed
    to convey irrigation water from the source of supply to one or more irrigated areas."
    (U.S. Department of Agriculture, 1995) This data set was created with geographic
    information systems (GIS) and database management tools. The acres on which ICL's
    are applied were totaled at the county level in the tabular NRI database and then
    apportioned to a raster coverage of agricultural land within the county based on
    the Enhanced National Land Cover Dataset (NLCDe) 1-kilometer resolution land cover
    grids (Nakagaki, 2003). Federal land is not considered in this analysis because
    NRI does not record information on those lands.",nt"owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",nt"extras":
